script: |
  super -f text -I q5249.spq | sort > q5249.out

inputs:
  - name: q5249.spq
    data: |
      SELECT DISTINCT 95 + cor0.col0 AS col2 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5249.out
    data: |
      102
      173
      174
